import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Account from './components/pages/account';
import Map from './components/pages/map';
import Stats from './components/pages/stats';
import Customers from './components/pages/customers';
import Products from './components/pages/products';
import Settings from './components/pages/settings';
import Login from './components/pages/login';
import Register from './components/pages/register';
import NotFound from './components/pages/stats/error';
import Testing from './components/pages/testing';
import ChangePassword from './components/pages/change_password';

function App() {


  return (
    <div className="App" color='#666666'>
      <Router basename={process.env.PUBLIC_URL}  >

        <Routes>
          <Route path='/' element={<Stats />}></Route>
          <Route path='/customers' element={<Customers />}></Route>
          <Route path='/products' element={<Products />}></Route>
          <Route path='/account' element={<Account />}></Route>
          <Route path='/settings' element={<Settings />}></Route>
          <Route path='/login' element={<Login />}></Route>
          <Route path='/register' element={<Register />}></Route>
          <Route path='/testing' element={<Testing />}></Route>
          <Route path='/maps' element={<Map />}></Route>
          <Route path='/error' element={<NotFound />}></Route>
          <Route path='/change_password' element={<ChangePassword />}></Route>
        </Routes>
      </Router>

    </div>
  )
}

export default App;
